import React from "react";
import TopNav from "../component/topNav/topnav";

export default class MainLayout extends React.Component {
  render() {
    return (
      <div id="app-wrapper">
        <div className="sticky-top">
          <TopNav />
        </div>
        {this.props.children}
      </div>
    );
  }
}
